import React, {useState} from "react";
import "./login.css"

const Login = () => {

    const [ user , setUser] = useState({
        email:"",
        password:""
    })

    const handleChange = e=> {
        const { name, value } = e.target
        setUser({
            ...user,
            [name]:value
        })
    }

    return (
        <div class="login">
            <h1>Login</h1>
            <input type="text" name="email" value={user.email} onChange={handleChange} placeholder="Enter your email"></input>
            <input type="password" name="email" value={user.email} onChange={handleChange} placeholder="Enter your email"></input>
            <div class="button">Login</div>
            <div class="or"> OR</div>
            <div class="button">Login with Google</div>
        </div>
    )
}

export default Login;
